  \"Comprehensive survey of 3,000 acres of Atlantic white cedar clearcut tracts on
  the Dare County Peninsula, North Carolina\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  10,\n\t\t\"recent\": 2\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T22:57:36.559378\",\n\t\"name\": \"comprehensive-survey-of-3000-acres-of-atlantic-white-cedar-clearcut-tracts-on-the-dare-cou\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The purpose of this study was to perform
  extensive regeneration surveys on 3,000 acres of land held by the U.S. Air Force
  Dare County Bombing Range and Alligator River National Wildlife Refuge on the Dare
  County Peninsula. In 1992, a cooperative project was initiated by the Alligator
  River National Wildlife Refuge, U.S. Air Force Dare County Range, North Carolina
  State University, and North Carolina Division of Forest Resources to oversee the
  restoration of Atlantic white cedar (Chamaecyparis thyoides (L.) B.S.P.) in clearcut
  tracts that were at one time mature cedar stands. The status of natural regeneration
  occurring in the 3,000 acres of clearcut tracts identified for this project was
  evaluated from 1995 to 1997. Results show that there is tremendous variability within
  and between stands in relation to stocking levels of Atlantic white cedar seedlings
  and the amount of competition. There is an abundance of stands(35 stands, or 78%)
  that have adequate levels of natural regeneration, but there is severe growth inhibition
  in 34 of these 35 stands. A key inhibitor of the natural regeneration of Atlantic
  white cedar stands seems to be the high level of shrub competition that exists in
  these clearcut tracts. Chemical release of Atlantic white cedar from particularly
  high levels of shrub competition through the application of Arsenalu00ae may allow
  it to grow freely in stands with adequate natural regeneration levels. This must
  be incorporated with modifications of the hydrologic regime, that has been altered
  by the construction of roads, in order for the Atlantic white cedar to regenerate
  in pure stands.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
